ourspace+'char grade;\n<hr class="s1" />\n} Student;\n<hr class="s2" />\nint main(void) {\n<hr class="s1" />\n'+h.fourspace+'Student *students = malloc(2 * sizeof(Student));\n<hr class="s1" />\n'+h.fourspace+'students[0].name = "Oski Bear";\n<hr class="s1" />\n'+h.fourspace+'students[0].id = 12345;\n<hr class="s1" />\n'+h.fourspace+"students[0].grade = 'A';\n<hr class=\"s1\" />\n"+h.fourspace+'students[1].name = "Ken Thompson";\n<hr class="s1" />\n'+h.fourspace+'students[1].id = 5678;\n<hr class="s1" />\n'+h.fourspace+"students[1].grade = 'A';\n<hr class=\"s2\" />\n"+h.fourspace+'printf("students: %p\n", students);\n<hr class="s1" />\n'+h.fourspace+'printf("Address of students[0]: %p\n", &(students[0]));\n<hr class="s1" />\n'+h.fourspace+'printf("Address of students[0].id: %p\n", &(students[0].id));\n<hr class="s2" />\n'+h.fourspace+'printf("students + 1: %p\n", students + 1);\n<hr class="s1" />\n'+h.fourspace+'printf("Address of students[1].grade: %p\n",\n<hr class="s1" />\n'+p+'&(students[1].grade));\n<hr class="s2" />\n'+h.fourspace+'return 0;\n<hr class="s1" />\n}\n</code>\n\n<hr class="s2" />\n\na)  Fill in the blanks in the program’s output below. Assume that the region of memory on the heap allocated by the call to malloc starts at address <code>0x1000</code>. Also, remember that C will print pointer values and memory addresses in <b>hexadecimal notation</b>.\n<hr class="s2" />\n<code>\nstudents: 0x1000\n<hr class="s1" />\nAddress of students[0]: '+h.blank+'\n<hr class="s1" />\nAddress of students[0].id: '+h.blank+'\n<hr class="s1" />\nstudents + 1: '+h.blank+'\n<hr class="s1" />\nAddress of students[1].grade: '+h.blank+"\n</code>\n",v="\n<code>\n"+h.fourspace+'students: 0x1000\n<hr class="s1" />\n'+h.fourspace+'Address of students[0]: <b>0x1000</b>\n<hr class="s1" />\n'+h.fourspace+'Address of students[0].id: <b>0x1004</b>\n<hr class="s1" />\n'+h.fourspace+'students + 1: <b>0x100C</b>\n<hr class="s1" />\n'+h.fourspace+"Address of students[1].grade: <b>0x1014</b>\n</code>\n",g='\nb)  <b>True | False</b> - The address of the <code>students</code> pointer is less than its value.\n<hr class="s1" />\ni.e. <code>&students < students</code>\n',y="\n<b>False</b>\n",_='\n<h3>Q2: This tree question needs acorny pun (10 points)</h3>\nWrite a function to sum up the values and free a tree of arbitrary size constructed using the\ntree_node <code>struct</code> as defined. Each node can have an arbitrary number of children. Assume that there will always be a valid pointer in the location of children.\n\n<hr class="s2" />\n\n<code>\nstruct tree_node {\n<hr class="s1" />\n'+h.fourspace+'int value;\n<hr class="s1" />\n'+h.fourspace+'struct tree_node ** children;\n<hr class="s1" />\n'+h.fourspace+'int num_children;\n<hr class="s1" />\n}\n\n<hr class="s2" />\n\nint sum_and_free_tree( struct tree_node * root ) {\n<hr class="s1" />\n'+h.fourspace+'int i, sum;\n<hr class="s1" />\n'+h.fourspace+'if ( root == NULL ) { // This is equivalent to being stumped\n<hr class="s1" />\n'+h.eightspace+'return 0;\n<hr class="s1" />\n'+h.fourspace+'}\n<hr class="s1" />\n'+h.fourspace+'sum = _______________________________________________;\n<hr class="s1" />\n'+h.fourspace+'for ( i = ____________;\n<hr class="s1" />\n'+f.repeat("&nbsp;",14)+'____________;\n<hr class="s1" />\n'+f.repeat("&nbsp;",14)+'____________ ) {\n<hr class="s1" />\n'+h.eightspace+'_______________________________________________;\n<hr class="s1" />\n'+h.fourspace+'}\n<hr class="s1" />\n'+h.fourspace+'free( _______________________________________________ );\n<hr class="s1" />\n'+h.fourspace+'free( _______________________________________________ );\n<hr class="s1" />\n'+h.fourspace+'return sum;\n<hr class="s1" />\n}\n</code>\n',w='\n<code>\nint sum_and_free_tree( struct tree_node * root ) {\n<hr class="s1" />\n'+h.fourspace+'int i, sum;\n<hr class="s1" />\n'+h.fourspace+'if ( root == NULL ) { // This is equivalent to being stumped\n<hr class="s1" />\n'+h.eightspace+'return 0;\n<hr class="s1" />\n'+h.fourspace+'}\n<hr class="s1" />\n'+h.fourspace+'sum = <b>root->value</b>;\n<hr class="s1" />\n'+h.fourspace+'for ( i = <b>0</b>;\n<hr class="s1" />\n'+f.repeat("&nbsp;",14)+'<b>i < root->num_children</b>;\n<hr class="s1" />\n'+f.repeat("&nbsp;",14)+'<b>i++</b> ) {\n<hr class="s1" />\n'+h.eightspace+'<b>sum += sum_and_free_tree((root->children)[i])</b>;\n<hr class="s1" />\n'+h.fourspace+'}\n<hr class="s1" />\n'+h.fourspace+'free( <b>root->children</b> );\n<hr class="s1" />\n'+h.fourspace+'free( <b>root</b> );\n<hr class="s1" />\n'+h.fourspace+'return sum;\n<hr class="s1" />\n}\n</code>\n',x='\n<h3>Q3: A filter in the blank question (20 points)</h3>\n\nConvert the <code>filter_array</code> function, which counts the number of elements greater than <code>min_val</code> in\nthe array and returns an integer, to MIPS assembly. You may not need all of the lines, but you should\ntry to use as few lines as possible.\n<hr class="s1" />\nAssume <code>$a0 = arr, $a1 = n, $a2 = min_val</code>.\n\n<hr class="s2" />\n\n<code>\nint filter_array(int* arr, size_t n, int min_val) {\n<hr class="s1" />\n'+h.fourspace+'int count = 0, i;\n<hr class="s1" />\n'+h.fourspace+'for (i=0; i < n; i++){\n<hr class="s1" />\n'+h.eightspace+'if (arr[i] > min_val)\n<hr class="s1" />\n'+p+'count++;\n<hr class="s1" />\n'+h.fourspace+'}\n<hr class="s1" />\n'+h.fourspace+'return count;\n<hr class="s1" />\n}\n\n<hr class="s2" />\n<hr class="s2" />\n<b>Example:</b>\n<hr class="s1" />\nint* p = (int*) malloc(sizeof(int)*3)\n<hr class="s1" />\np[0] = 1;\n<hr class="s1" />\np[1] = 2;\n<hr class="s1" />\np[2] = 3;\n<hr class="s1" />\nprintf("%d\n", filter_array(p,3,1))\n<hr class="s1" />\n<b>Output: 2</b>\n<hr class="s2" />\n<hr class="s2" />\n\nfilter_array:\n<hr class="s1" />\n'+h.fourspace+'addiu $sp, $sp, ____\n<hr class="s1" />\n'+h.fourspace+'___________________\n<hr class="s1" />\n'+h.fourspace+'___________________\n<hr class="s1" />\n'+h.fourspace+'___________________\n<hr class="s1" />\n'+h.f